// 1576143863

function CheckTimeOut(input) {
    console.log("timeout", input)
    if (input === 0) {
        return "Active Channel, No TimeOut"
    }
    input = parseInt(input) * 1000
    return new Date(input).toUTCString()
}


export { CheckTimeOut }
